script: |
  super -f text -I q8644.spq | sort > q8644.out

inputs:
  - name: q8644.spq
    data: |
      SELECT - col0 + + 68 FROM tab1 (FORMAT parquet) WHERE NOT NULL NOT IN ( + + col2, + 3 * + + col1, - col1, + col0, - ( + - col0 ), + col1, - 7, + col0 );
  - name: tab1

outputs:
  - name: q8644.out
    data: |
